import React, { Component } from 'react';
import { BrowserRouter, Route, Switch, Redirect } from 'react-router-dom';
import home from './home';

import viewDetail from './viewDetail';
class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div>
          <Redirect
            from="/"
            to="/home" />
          <Switch>
            <Route
              path="/home"
              component={home} />
            <Route
              exact
              path="/viewDetail"
              render={() => <viewDetail name="vista detalle" />} />
          </Switch>
        </div>
      </BrowserRouter>
    );
  }
}
export default App;
